function Line3d(x0,y0,z0,x1,y1,z1)
{

	var canvas = document.getElementById('mycanvas');
	if (canvas.getContext)
	{
	    var ctx = canvas.getContext('2d');
		var aspect = 1;
		var escala = 40;

		ctx.beginPath();
		var d = 250;
		var OX = 400;
		var OY = 300;
		var ep = 0.01;

		
		var m11 = 1;
		var m12 = 0;
		var m13 = 0;

		var m21 = 0;
		var m22 = 1;
		var m23 = 0;

		var m31 = 0.141;
		var m32 = 0.141;
		var m33 = 0.707;

		var xs = x0*m11 + y0*m21 + z0*m31;
		var ys = x0*m12 + y0*m22 + z0*m32;
		var zs = x0*m13 + y0*m23 + z0*m33;
		x0 = xs;
		y0 = ys;
		z0 = zs;

		xs = x1*m11 + y1*m21 + z1*m31;
		ys = x1*m12 + y1*m22 + z1*m32;
		zs = x1*m13 + y1*m23 + z1*m33;
		x1 = xs;
		y1 = ys;
		z1 = zs;


		z0+=d;
		z1+=d;
		var flag = true;
		var vx = x1 - x0;
		var vy = y1 - y0;
		var vz = z1 - z0;
		for(var t =0.0 ; t<1.0;t+=ep )
		{
			var X = (x0+t*vx)/(z0+t*vz ) *d *escala;
			var Y = (y0+t*vy)/(z0+t*vz ) *d * aspect*escala;

			if(flag==true)
			{
				flag = false;
				ctx.moveTo(OX + X, OY - Y);
			}
			else
				ctx.lineTo(OX + X, OY - Y);


		}

		ctx.closePath();
		ctx.stroke();

	}

}

function draw3dBox(x,y,z,dx,dy,dz)
{
 	Line3d(x,y,z, x+dx,y,z);
 	Line3d(x+dx,y,z, x+dx,y+dy,z);
 	Line3d(x+dx,y+dy,z, x,y+dy,z);
 	Line3d(x,y+dy,z, x,y,z);

 	Line3d(x,y,z+dz, x+dx,y,z+dz);
 	Line3d(x+dx,y,z+dz, x+dx,y+dy,z+dz);
 	Line3d(x+dx,y+dy,z+dz, x,y+dy,z+dz);
 	Line3d(x,y+dy,z+dz, x,y,z+dz);

 	Line3d(x,y,z, x,y,z+dz);
 	Line3d(x+dx,y,z, x+dx,y,z+dz);
 	Line3d(x,y+dy,z, x,y+dy,z+dz);
 	Line3d(x+dx,y+dy,z, x+dx,y+dy,z+dz);

}

function drawShape(){
  // get the canvas element using the DOM
  var canvas = document.getElementById('mycanvas');
 
  // Make sure we don't execute when canvas isn't supported
  if (canvas.getContext){
 
    // use getContext to use the canvas for drawing
    var ctx = canvas.getContext('2d');
 
    // Filled triangle
    ctx.beginPath();
    ctx.moveTo(25,25);
    ctx.lineTo(105,25);
    ctx.lineTo(25,105);
    ctx.fill();
    
    // Stroked triangle
    ctx.beginPath();
    ctx.moveTo(125,125);
    ctx.lineTo(125,45);
    ctx.lineTo(45,125);
    ctx.closePath();
    ctx.stroke();
 
  } else {
    alert('You need Safari or Firefox 1.5+ to see this demo.');
  }
}
